  Texas COVID-19 Vaccine Tracker





  The reach of COVID-19 on Texas and the world has been devastating. As our state joins a global effort to put coronavirus into our past, we are tracking the Texas vaccine roll-out as it unfolds in real-time.
  Texas has 24,068,624 people aged 12 and older who are currently eligible for the vaccine. As of May 31, 2021, the state has:


   | Fully Vaccinated: 10,320,821 people or 43% of the population 12+  | Vaccinated w/ At Least One Dose: 12,792,216 people or 53% of the population 12+  | Administered: 8,377 doses in one day on May 31, 2021 or 0.03% of the population 12+  | A 7-Day Average of 68,053 administered per day or 0.28% of the population 12+



